import React from 'react';
import styled from 'styled-components';

const Work = () => (
    <WorkContainer>
        <Project>
            <ProjectTitle>Dev Tracker</ProjectTitle>
            <Hr />
            <ProjectDescription>Dev Tracker is a web application that we built for Dev Point Labs that allows students to log in and track current applications, interviews, and phone calls for companies they are interested in.</ProjectDescription>
            <Features>
                <Feature>
                    <FeatureTitle>Application Tracking</FeatureTitle>
                    <FeatureDescription></FeatureDescription>
                </Feature>
                <Feature>Task List</Feature>
                <Feature>Event Tracking</Feature>
                <Feature>Contacts</Feature>
                <Feature>Contacts</Feature>
            </Features>
        </Project>
        <Project>

        </Project>
        <Project>

        </Project>
    </WorkContainer>

)

const Feature = styled.li``;
const FeatureTitle = styled.h4``;
const FeatureDescription = styled.p``;

const Features = styled.ul`
    list-style: none;
    width: 100%;
`;

const Hr = styled.hr`
    width: 50%;
    margin: 10px 0;
`;

const WorkContainer = styled.div`
    display: grid;
    grid-template-columns: 1fr;
    grid-gap: 1em;
    height: 100%;
    min-height: 100vh;
    padding: 100px 2em;
    max-width: 600px;
    width: 100%;
    margin: 0 auto;
`;

const Project = styled.div`

`;

const ProjectTitle = styled.h2`

`;

const ProjectDescription = styled.p`

`;

export default Work;
